SQL Query:
SELECT cpi_2022.area_name, ((cpi_2022.value - cpi_2017.value) / cpi_2017.value) AS inflation_rate FROM bls_consumer_price_index cpi_2022, bls_consumer_price_index cpi_2017 WHERE cpi_2022.item_name = 'All items' AND cpi_2022.year = 2022 AND cpi_2022.period_name = 'Annual' AND cpi_2022.seasonal = 'Not Seasonally Adjusted' AND cpi_2022.area_type = 'Region' AND cpi_2017.item_name = 'All items' AND cpi_2017.year = 2017 AND cpi_2017.period_name = 'Annual' AND cpi_2017.seasonal = 'Not Seasonally Adjusted' AND cpi_2017.area_type = 'Region' AND cpi_2022.area_name = cpi_2017.area_name ORDER BY inflation_rate DESC LIMIT 1
UNION
SELECT cpi_2022.area_name, ((cpi_2022.value - cpi_2017.value) / cpi_2017.value) AS inflation_rate FROM bls_consumer_price_index cpi_2022, bls_consumer_price_index cpi_2017 WHERE cpi_2022.item_name = 'All items' AND cpi_2022.year = 2022 AND cpi_2022.period_name = 'Annual' AND cpi_2022.seasonal = 'Not Seasonally Adjusted' AND cpi_2022.area_type = 'Region' AND cpi_2017.item_name = 'All items' AND cpi_2017.year = 2017 AND cpi_2017.period_name = 'Annual' AND cpi_2017.seasonal = 'Not Seasonally Adjusted' AND cpi_2017.area_type = 'Region' AND cpi_2022.area_name = cpi_2017.area_name ORDER BY inflation_rate ASC LIMIT 1;
